export const ProductsTable = ({ product }: { product: IProduct }) => {
  const categories = useAppSelector((state) => state.categories);
  console.log(product.category.name)
  return (
    <tbody>
    <tr>
      <td>{product._id}</td>
      <td>{product.name}</td>
      <td>{product.category.name}</td>
      <td>{product.price}</td>
      <td>{product.amount}</td>
      <td>{product.image}</td>
    </tr>
    </tbody>
  );
};
